import favLine from "./favLine"



function myFav(props){

    return(

<div>
<h1>My Favorite pets</h1>
{props.favList.map(x=> <favLine img={x.photo} name={x.animalName} size={x.size}></favLine> )}


<div className="animLine" key={props.id}> <img src={props.photo} alt="no image" /> <h5>{`Name:${props.animalName}  Size:${props.size}  status:${props.status}`}</h5> </div>
</div>


)}

export default myFav
